  [],\n\t\"revision_timestamp\": \"2015-05-06T21:00:45.495102\",\n\t\"name\": \"rotcfd-a-viscous-design-tool-for-advanced-configurations-project-46086\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"During initial design studies, parametric
  variation of vehicle geometryrnis routine. In addition, rotorcraft engineers traditionally
  use the wind tunnel to evaluate and finalize designs. Correlation between wind tunnel
  results and flight tests, when not good, have been often attributed in part to uncertainty
  in blockage corrections. Estimation of rotor blockage is significantly more complex
  than bluff body corrections as the correction depends on operational characteristics
  such rnas rotor RPM and thrust produced.rnrnThis proposal offers to develop an Integrated
  Design Environment (IDE) which can simulate a complete rotorcraft with or without
  wind tunnel walls including all the facility effects.rnrnAt the heart of the innovation
  are:rnrn1. An automated hybrid grid generator. (viscous grids near the bodies and
  rnunstructured Cartesian grid everywhere else)rn2. A robust and economical incompressible
  flow solver for the entire system of grids.rn3. Momentum source based rotor model
  that is suitable and economical rnfor simulating configurations with multiple rotors.rnrnIn
  Phase I, the proof-of-concept developed used unstructured Cartesian rngrid for the
  model and wind tunnel.rnrnIn phase II, the tool will be extended to hybrid grid
  with viscous grid near solid surfaces and will include several tools including a
  simple CAD like geometry manipulation tool and pre- and post-processing tools all
  integrated in one environment to facilitate ease of use.\",\n\t\"license_title\":
